While we use rust struct definitions here, it's important to keep in mind that as mentioned above, we'll need to support the manager being written in something other than rust, and to support engines written in other than rust. The structures below are a straw-man, but hopefully capture all the information that needs to be passed around. // We want to define a list of "engine IDs" - ie, canonical strings which
// refer to what the user perceives as an "enigine" - but as above, these
// *do not* correspond 1:1 with either "stores" or "collections" (eg, "history"
// refers to 2 stores, and in a future world, might involve 3 collections).
enum Engine { History, // The "History" and "Forms" stores. Bookmarks, // The "Bookmark" store. Passwords,
} impl Engine { fn as_str(&self) -> &'static str { match self { History => "history", // etc }
} // A struct which reflects engine declined states.
struct EngineState { engine: Engine, enabled: bool,
} // A straw-man for the reasons why a sync is happening.
enum SyncReason { Scheduled, User, PreSleep, Startup,
} // A straw man for the general status.
enum ServiceStatus { Ok, // Some general network issue. NetworkError, // Some apparent issue with the servers. ServiceError, // Some external FxA action needs to be taken. AuthenticationError, // We declined to do anything for backoff or rate-limiting reasons. BackedOff, // Something else - you need to check the logs for more details. OtherError,
} // Info we need from FxA to sync. This is roughly our Sync15StorageClientInit
// structure with the FxA device ID.
struct AccountInfo { key_id: String, access_token: String, tokenserver_url: Url, device_id: String,
} // Instead of massive param and result lists, we use structures.
// This structure is passed to each and every sync.
struct SyncParams { // The engines to Sync. None means "sync all" engines: Option<Vec<Engine>>, // Why this sync is being done. reason: SyncReason, // Any state changes which should be done as part of this sync. engine_state_changes: Vec<EngineState>, // An opaque state "blob". This should be persisted by the app so it is // reused next sync. persisted_state: Option<String>,
} struct SyncResult { // The general health. service_status: ServiceStatus, // The result for each engine. engine_results: HashMap<Engine, Result<()>>, // The list of declined engines, or None if we failed to get that far. declined_engines: Option<Vec<Engine>>, // When we are allowed to sync again. If > now() then there's some kind // of back-off. Note that it's not strictly necessary for the app to // enforce this (ie, it can keep asking us to sync, but we might decline). // But we might not too - eg, we might try a user-initiated sync. next_sync_allowed_at: Timestamp, // New opaque state which should be persisted by the embedding app and supplied // the next time Sync is called. persisted_state: String, // Telemetry. Nailing this down is tbd. telemetry: Option<JSONValue>,
} struct SyncManager {} impl SyncManager { // Initialize the sync manager with the set of Engines known by this // application without regard to the enabled/declined states. // XXX - still TBD is how we will pass "stores" around - it may be that // this function ends up taking an `impl Store` fn init(&self, engines: Vec<&str>) -> Result<()>; fn sync(&self, params: SyncParams) -> Result<SyncResult>; // Interrupt any current syncs. Note that this can be called from a different // thread. fn interrupt() -> Result<()>; // Disconnect this device from sync. This may "reset" the stores, but will // not wipe local data. fn disconnect(&self) -> Result<()>; // Wipe all local data for all local stores. This can be done after // disconnecting. // There's no exposed way to wipe the remote store - while it's possible // stores will want to do this, there's no need to expose this to the user. fn wipe(&self) -> Result<()>;
} Found a bug? Edit this file on GitHub.

